import React from 'react';
import './App.css';
import IsRaining from './isRaining';

class App extends React.Component {

  constructor() {
    super();
    this.state = {
      isRain : false
    }
  }

  render () {
    return (
      <IsRaining 
      isRain={this.state.isRain}
      />
    );
  }

}

export default App;
